DROP TABLE IF EXISTS `addresses`;
CREATE TABLE `addresses` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `code` varchar(50) CHARACTER SET utf8mb4 DEFAULT NULL,
  `name` varchar(255) CHARACTER SET utf8mb4 DEFAULT NULL,
  `description` text CHARACTER SET utf8mb4,
  `type` varchar(255) CHARACTER SET utf8mb4 DEFAULT NULL,
  `parent_code` varchar(50) CHARACTER SET utf8mb4 DEFAULT NULL,
  `reference` text CHARACTER SET utf8mb4,
  `official_note` text CHARACTER SET utf8mb4,
  `note by_checker` text CHARACTER SET utf8mb4,
  PRIMARY KEY (`id`) USING BTREE,
  KEY `code` (`code`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=160855 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

